function matchAndConvertToCSV(typedStaffNames, upToDateStaffAndSchools) {
  
    // Normalize name for comparison - extract actual name parts
    function extractNameParts(name) {
      if (!name || typeof name !== 'string') return [];
      
      return name
        .toLowerCase()
        .replace(/mrs?\.|miss|dr\.|prof\./gi, '') // remove titles
        .replace(/[.,]/g, '')                      // remove punctuation
        .replace(/\s+/g, ' ')                      // normalize spaces
        .trim()
        .split(' ')
        .filter(word => word.length > 1);          // only words with 2+ chars
    }
  
    // Better name matching - checks if key name parts match
    function calculateNameMatch(typedName, dbName) {
      const typedParts = extractNameParts(typedName);
      const dbParts = extractNameParts(dbName);
      
      if (typedParts.length === 0 || dbParts.length === 0) return 0;
      
      // Count how many typed name parts appear in db name
      let matchCount = 0;
      let partialMatchCount = 0;
      
      typedParts.forEach(typedPart => {
        // Exact match
        if (dbParts.includes(typedPart)) {
          matchCount++;
        } else {
          // Partial match (one word contains the other)
          dbParts.forEach(dbPart => {
            if (typedPart.length >= 3 && dbPart.length >= 3) {
              if (typedPart.includes(dbPart) || dbPart.includes(typedPart)) {
                partialMatchCount += 0.5;
              }
            }
          });
        }
      });
      
      // Score based on matches
      const totalMatches = matchCount + partialMatchCount;
      // Require at least 2 parts to match or high partial match score
      const score = totalMatches / Math.max(typedParts.length, 2);
      
      return score;
    }
  
    // Find best match for each typed name
    const matchedResults = [];
    const usedIndices = new Set(); // Track used matches to avoid duplicates
    
    typedStaffNames.forEach((typedName, index) => {
      let bestMatch = null;
      let bestScore = 0;
      let bestIndex = -1;
      
      upToDateStaffAndSchools.forEach((dbStaff, dbIndex) => {
        // Skip if already matched (uncomment to prevent duplicate matches)
        // if (usedIndices.has(dbIndex)) return;
        
        const score = calculateNameMatch(typedName, dbStaff.staffName || '');
        
        if (score > bestScore) {
          bestScore = score;
          bestMatch = dbStaff;
          bestIndex = dbIndex;
        }
      });
      
      // Only match if score is reasonable (at least 30% match - lowered threshold)
      if (bestMatch && bestScore >= 0.3) {
        usedIndices.add(bestIndex);
        matchedResults.push({
          serialNo: index + 1,
          typedName: typedName.replace(/,$/, '').trim(),
          matchedName: bestMatch.staffName,
          schoolName: bestMatch.schoolName || 'N/A',
          matchScore: bestScore.toFixed(2)
        });
      } else {
        // No good match found
        matchedResults.push({
          serialNo: index + 1,
          typedName: typedName.replace(/,$/, '').trim(),
          matchedName: 'NO MATCH FOUND',
          schoolName: 'N/A',
          matchScore: '0.00'
        });
      }
    });
    
    return matchedResults;
  }
  
  // Convert to CSV
  function arrayToCSV(data) {
    if (!data || data.length === 0) return '';
    
    const headers = Object.keys(data[0]);
    
    function escapeCSV(value) {
      if (value == null) return '';
      const stringValue = String(value);
      if (stringValue.includes(',') || stringValue.includes('"') || stringValue.includes('\n')) {
        return `"${stringValue.replace(/"/g, '""')}"`;
      }
      return stringValue;
    }
    
    let csv = headers.map(escapeCSV).join(',') + '\n';
    
    data.forEach(row => {
      const values = headers.map(header => escapeCSV(row[header]));
      csv += values.join(',') + '\n';
    });
    
    return csv;
  }
  
  // MAIN FUNCTION
  function matchStaffAndExportCSV(typedStaffNames, upToDateStaffAndSchools) {
    const matchedData = matchAndConvertToCSV(typedStaffNames, upToDateStaffAndSchools);
    const csvContent = arrayToCSV(matchedData);
    
    // Log for debugging
    console.log('=== MATCHING RESULTS ===');
    matchedData.forEach(item => {
      console.log(`${item.serialNo}. "${item.typedName}" -> "${item.matchedName}" (Score: ${item.matchScore})`);
    });
    
    return {
      matchedData,
      csvContent,
      csvBlob: new Blob([csvContent], { type: 'text/csv;charset=utf-8;' })
    };
  }
  
 
  
  const result = matchStaffAndExportCSV(typedStaffNames, upToDateStaffAndSchools);
  
  // Print results
  console.log('\n=== MATCHED DATA TABLE ===');
  console.table(result.matchedData);
  
  console.log('\n=== CSV CONTENT ===');
  console.log(result.csvContent);
  // USAGE:
  // First, check your data structure:
  // debugDataStructure(upToDateStaffAndSchools);
  
